import './App.css';
import { useState } from 'react';
import Navbar from './components/Navbar';
import CompetitionTable from './CompetitionTable';
import About from './components/About';
import Calculator from './components/Calculator';
import EventComparison from './components/EventComparison';

function App() {
  const [activeTab, setActiveTab] = useState('calculator');
  const [calculatorData, setCalculatorData] = useState(null);

  const handleCalculatorData = (data) => {
    setCalculatorData(data);
  };

  const calculatePerformance = async (points, eventType) => {
    try {
      const response = await fetch('http://localhost:5001/api/calculate-performance', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          event_type: eventType,
          points: points,
          gender: calculatorData?.gender || 'mens',
          season: calculatorData?.season || 'outdoor'
        }),
      });
      const data = await response.json();
      return data.performance;
    } catch (error) {
      console.error('Error calculating performance:', error);
      return 'N/A';
    }
  };

  return (
    <div className="App">
      <Navbar activeTab={activeTab} setActiveTab={setActiveTab} />
      <main className="main-content">
        {activeTab === 'calculator' ? (
          <div className="content-container">
            <Calculator 
              isWorldRankings={false} 
              onCalculate={handleCalculatorData}
            />
            <div className="comparison-wrapper">
              {calculatorData && (
                <EventComparison 
                  points={calculatorData.points}
                  gender={calculatorData.gender}
                  season={calculatorData.season}
                />
              )}
            </div>
          </div>
        ) : activeTab === 'competition' ? (
          <div>
            <Calculator 
              isWorldRankings={true}
              onCalculate={handleCalculatorData}
            />
            <CompetitionTable 
              points={calculatorData?.points}
              eventType={calculatorData?.eventType}
              onCalculatePerformance={calculatePerformance}
            />
          </div>
        ) : (
          <About />
        )}
      </main>
    </div>
  );
}

export default App;
